import React from 'react';

const Experience: React.FC = () => {
    const experiences = [
        {
            title: "B.E. Information Science",
            company: "BLDE Engineering College, Vijayapura",
            period: "2021 - 2025",
            description: [
                "Currently pursuing Bachelor of Engineering in Information Science",
                "Maintaining a strong academic record with CGPA of 7.23",
                "Learning modern web development technologies and frameworks",
                "Participating in college tech events and projects"
            ],
            technologies: ["React", "JavaScript", "C++", "MySQL", "Git"]
        },
        {
            title: "Higher Secondary Education",
            company: "Sai Niketan Independent PU College, Mudhol",
            period: "2021",
            description: [
                "Completed 12th standard with 79.17% marks",
                "Developed strong foundation in mathematics and science",
                "Participated in various academic and extracurricular activities"
            ],
            technologies: ["Mathematics", "Physics", "Chemistry", "Computer Science"]
        }
    ];

    const achievements = [
        {
            title: "Tech Team Lead - Project Leadership",
            description: "Led a college tech team project, assigned tasks, and ensured delivery through collaboration and problem-solving."
        }
    ];

    return (
        <section id="experience" className="experience">
            <div className="container">
                <h2 className="section-title">Education & Achievements</h2>
                <div className="experience-timeline">
                    {experiences.map((exp, index) => (
                        <div key={index} className="experience-item">
                            <div className="experience-header">
                                <h3>{exp.title}</h3>
                                <div className="experience-meta">
                                    <span className="company">{exp.company}</span>
                                    <span className="period">{exp.period}</span>
                                </div>
                            </div>
                            <div className="experience-content">
                                <ul>
                                    {exp.description.map((item, itemIndex) => (
                                        <li key={itemIndex}>{item}</li>
                                    ))}
                                </ul>
                                <div className="experience-technologies">
                                    {exp.technologies.map((tech, techIndex) => (
                                        <span key={techIndex} className="tech-tag">{tech}</span>
                                    ))}
                                </div>
                            </div>
                        </div>
                    ))}
                </div>
                
                <div className="achievements-section">
                    <h3 style={{ textAlign: 'center', marginBottom: '2rem', color: '#1f2937' }}>Key Achievements</h3>
                    <div className="achievements-grid">
                        {achievements.map((achievement, index) => (
                            <div key={index} className="achievement-item">
                                <h4>{achievement.title}</h4>
                                <p>{achievement.description}</p>
                            </div>
                        ))}
                    </div>
                </div>
            </div>
        </section>
    );
};

export default Experience;
